import ListMovies from './Components/ListMovies.js'
import './App.css'

function App() {
  return (
    <div className="Container" style={{paddingTop: '30px'}}>
      <div className="row">
      <h1 className="text-center mx-auto display-4 text-bold "> My Games List</h1>
      </div>
      <div className="row"></div>
      <ListMovies />
    </div>
  );
}

export default App;
